import React from "react";
import { Waypoint } from "react-waypoint";

class SectionAboutUs extends React.Component {
  render() {
    return (
      <div>
        <Waypoint
          onEnter={() => alert("Entered Red Section")}
          onLeave={() => alert("Left")}
        >
          <h1> SECTION START </h1>
        </Waypoint>
      </div>
    );
  }
}

export default SectionAboutUs;
